import React, { useState, useEffect } from 'react';
import Axios from "axios";
import { Typography, Button } from "@mui/material";

import AllMeals from '../components/AllMeals';

const Summary = (props) => {

    const [daily, setDaily] = useState({
        user: props.user,
        stamp: null,
        data: null

    })

    useEffect(() => {
        Axios.get("http://magfooddiary-env.eba-bh6g2nuu.us-east-2.elasticbeanstalk.com/day")
        .then(result => console.log("STAMP API: " + result.data.stamp))
        // .then(result =>  setDaily({ ...daily, user: props.user, stamp: result.data.stamp }))
        .catch(err => console.log(err))
    }, [])

    if(daily.stamp == null)
    return(
        <div>
            Summary
        </div>
    )

    return (
        <div>
            Summary
            <AllMeals user={daily.user} stamp={daily.stamp}/>
        </div>
    )
}
export default Summary;
